INSERT INTO restaurant_t_and_cs VALUES(1,replace('\n# プライバシーポリシー\n\nLYNKED株式会社（以下「当社」といいます。）は、当社のサービスを利用する方（以下「利用者」といいます。）の個人情報の取扱いについて、以下のとおり個人情報保護方針を定め、個人情報保護の仕組みを構築し、全従業員に個人情報保護の重要性を認識させるとともにその取組みを徹底させることにより、個人情報の保護を推進します。\n\n \n\n## 第 1 条（個人情報）\n\n「個人情報」とは、個人情報の保護に関する法律（平成十五年法律第五十七号、以下「個人情報保護法」といいます。）にいう「個人情報」を指し、生存する個人に関する情報であって、当該情報に含まれる氏名、生年月日その他の記述等により特定の個人を識別できるもの又は個人識別符号が含まれるものを指します。\n\n## 第 2 条（個人情報の取得と利用）\n\n- 当社は、以下の目的に必要な範囲で、利用者の個⼈情報を取得し、取得した情報を利用させていただきます。以下の⽬的の範囲を超えて個⼈情報を利⽤する場合には、事前に適切な⽅法で利用者からの同意を得るものとします。\n- 当社のサービス（以下「本サービス」といいます。）を提供するため\n- 本サービスの内容を改良・改善し、又は新サービスを開発するため\n- 本サービスの新機能、更新情報、キャンペーン等及び当社が提供する他のサービスのご案内（電子メール、チラシ、その他のダイレクトメールの送付を含む）のため\n- メンテナンス、重要なお知らせなど必要に応じたご連絡のため\n- 本サービスに関する利用者からのお問い合わせに回答するため（本人確認を行うことを含む）\n- 本サービスの利用状況を利用者にご報告するため\n- 本サービスに関するアンケート・取材等のご協力依頼や各種イベントへのご参加をお願いし、又はその結果などをご報告するため\n- 本サービスの利用履歴等を調査・分析し、その結果を本サービスの改良・開発や広告の配信に利用するため\n- 利用規約に違反した利用者や、不正・不当な目的で本サービスを利用しようとする利用者の特定をし、ご利用をお断りするため\n- 当社は、特定の個人を識別できない形で、収集した情報を統合して利用することがあります。当社が収集する統合情報の種類には、当社ウェブサイトへのアクセス頻度、入力された検索用語、当社ウェブサイトで最も頻繁にアクセスされるページ、利用者の場所、年齢、性別（総称して以下「統合情報」といいます。）が含まれる場合があります。当社は、利用者の本サービスの満足度を向上するために、特定の個人の特徴を特定することなく、利用者の一般的な属性情報を利用するものとします。当社ウェブサイトで収集された統合情報は、本サービスに関するいかなる方法でも利用及び開示される可能性があります。\n\n \n\n## 第 3 条（個人情報の管理と保護）\n\n個人情報の管理は、厳重に行うこととし、次に掲げる場合を除き、利用者の同意がない限り、第三者に対しデータを開示・提供することはいたしません。 また、安全性を考慮し、個人情報への不正アクセス、個人情報の紛失、破壊、改ざん及び漏えい等のリスクに対する予防並びに是正に関する対策を講じます。\n\n人の生命、身体又は財産の保護のために必要がある場合であって、利用者の同意を得ることが困難である場合\n\n公衆衛生の向上又は児童の健全な育成の推進のために特に必要がある場合であって、利用者の同意を得ることが困難である場合\n\n国の機関若しくは地方公共団体又はその委託を受けた者が法令の定める事務を遂行することに対して協力する必要がある場合であって、利用者の同意を得ることにより当該事務の遂行に支障を及ぼすおそれがある場合\n\n業務を円滑に遂行するため、利用目的の達成に必要な範囲内において個人情報の取扱いの全部又は一部を委託する場合\n\n合併その他の事由による事業の承継に伴って個人情報が提供される場合\n\n個人情報を特定の者との間で共同して利用する場合であって、その旨並びに共同して利用される個人情報の項目、共同して利用する者の範囲、利用する者の利用目的及び当該個人情報の管理について責任を有する者の氏名又は名称について、あらかじめ利用者に通知し、又は利用者が容易に知り得る状態に置いた場合\n\nその他法令で認められる場合\n\n \n\n第 4 条（個人情報の取扱いの委託）\n\n当社は、利用目的の達成に必要な範囲内において、個人情報の取扱いの全部又は一部を委託する場合がございます。この場合、当社は、委託先としての適格性を十分審査するとともに、契約にあたって守秘義務に関する事項等を定め、委託先に対する必要かつ適切な監督を行います。また、当社は、取得個人情報の全部又は一部を、個人情報保護法の定めに基づいて共同利用することがございます。\n\n \n\n第 5 条（行動履歴、属性情報及び第三者の広告配信について）\n\n当社は、利用者にとってより使いやすく、より価値ある情報をご提供するためにCookie（以下、「クッキー」といいます。これに類似の技術を含みます。）を使用することがあります。クッキーは、当社ウェブサイトを利用されたときにご利用の端末に一時的にデータを保存させるもので、これを利用することにより当社のサーバーに、当社ウェブサイト内における利用者の行動履歴（アクセスしたページ、コンテンツ、参照順序等）や、年齢や性別、職業、居住地域、ご来店履歴、位置情報等個人が特定できない属性情報（それらの組み合わせによっても個人が特定できないもの）を取得することがあります。利用者がご自身に関する情報の取得を望まれない場合は、ブラウザの設定により、クッキーの受け取りを拒否することも可能です。ブラウザの設定方法は各ソフト製造元へお問合わせください。なお、クッキーの受け取りを拒否された場合、ログイン保持機能等、当社サービスの一部がご利用できなくなることがあります。\n\n当社は、第三者が提供する広告配信サービスを利用しております。その際、当該第三者は、クッキー等によって利用者の当社ウェブサイトへのご訪問・行動履歴情報を取得、利用する場合があります。当該第三者によって取得されたクッキー情報等は、当該第三者のプライバシーポリシーに従って取扱われます。お客様は、当該第三者のウェブサイト内に設けられたオプトアウトページにアクセスして、当該第三者によるクッキー情報等を利用する広告配信を停止することができます。\n\n \n\n第 6 条（個人情報の開示）\n\n当社は、利用者から個人情報の開示を求められたときは、利用者に対し、遅滞なくこれを開示します。但し、開示することにより次のいずれかに該当する場合は、その全部又は一部を開示しないこともあり、開示しない決定をした場合には、その旨を遅滞なく通知します。\n\n利用者又は第三者の生命、身体、財産その他の権利利益を害するおそれがある場合\n\n当社の業務の適正な実施に著しい支障を及ぼすおそれがある場合\n\nその他法令に違反することとなる場合\n\n \n\n第 7 条（個人情報の訂正及び削除）\n\n当社の保有する個人情報が誤った情報である場合には、利用者の請求により、当社が定める手続きに従い個人情報の訂正又は削除を行います。\n\n当社は、利用者から前項の請求を受けてその請求に応じる必要があると判断した場合には、遅滞なく、当該個人情報の訂正又は削除を行い、これを利用者に通知します。\n\n \n\n第 8 条（個人情報の利用停止等）\n\n当社は、利用者から、個人情報が、利用目的の範囲を超えて取り扱われているという理由、又は不正の手段により取得されたものであるという理由により、その利用の停止又は消去（以下「利用停止等」といいます。）を求められた場合には、遅滞なく必要な調査を行い、その結果に基づき、個人情報の利用停止等を行い、その旨利用者に通知します。但し、個人情報の利用停止等に多額の費用を有する場合その他利用停止等を行うことが困難な場合であって、利用者の権利利益を保護するために必要なこれに代わるべき措置をとれる場合は、この代替策を講じます。\n\n \n\n第 9 条（プライバシーポリシーの変更手続）\n\n当社は本ポリシーの内容を適宜見直し、その改善に努めます。本ポリシーの内容は、法令その他本ポリシーに別段の定めのある事項を除いて、変更することができるものとします。変更後のプライバシーポリシーは、当社所定の方法により、利用者に通知し、又は当社ウェブサイトに掲載したときから効力を生じるものとします。\n\n \n\n第 10 条（当ウェブサイトのリンク先の取扱い）\n\n当社ウェブサイトがリンクする第三者のウェブサイトには本ポリシーは適用されません。これらのウェブサイトにおける個人情報の取り扱いについては、当該ウェブサイトのプライバシーポリシーなどをご参照ください。当該ウェブサイトにおける利用者の個人情報の取り扱いについて、当社は責任を負うものではありません。\n\n \n\n第 11 条（法令、規範の遵守）\n\n当社は、保有する個人情報に関して適用される日本の法令、その他規範を遵守します。\n\n \n\n第 12 条（苦情及び相談への対応）\n\n当社は、個人情報の取扱いに関する利用者からの苦情、相談を受け付け、適切かつ迅速に対応いたします。また、利用者からの当該個人情報の開示、訂正、追加、削除、利用又は提供の拒否などのご要望に対しても、迅速かつ適切に対応いたします。\n\n \n\n第 13 条（お問い合わせ窓口）\n\n当社の個人情報の取扱に関するお問い合せは下記までご連絡ください。\nLUNKED株式会社　お客様対応窓口\n〒108-0023　【東京都港区芝浦3-17-11天翔オフィス田町502】\nTEL: 03-6275-1510\n\nMail: info@lynked.co.jp\n\n \n\n \n\n２０２１年０６月０１日制定・施行','\n',char(10)),1648750002597,1648752129508,1648750003038,1,1,'en','test_t_and_c');
